import requests

# Attempt alternative authentication endpoint
auth_url = 'http://the-agent-company.com:8929/api/v4/users/sign_in'
headers = {'Content-Type': 'application/json'}
credentials = {'login': 'root', 'password': 'theagentcompany'}

try:
    response = requests.post(auth_url, json=credentials, headers=headers)
    response.raise_for_status()
    token = response.headers.get('Private-Token') or response.json().get('private_token')

    if not token:
        print(f"Auth failed. Response: {response.status_code} {response.text}")
        raise ValueError("No private token found in response")

    # Rest of original code with obtained token...

except Exception as e:
    print(f"Critical authentication failure: {str(e)}")
    raise

