```
// Delete remaining projects with precise confirmation flow
const projectsToDelete = [
    'bustub',
    'colly',
    'copilot-arena-server',
    'Documentation',
    'janusgraph',
    'llama.cpp',
    'node-red',
    'openhands',
    'opensearch',
    'raft',
    'risingwave',
    'streamlit'
];

for (const project of projectsToDelete) {
    // Navigate to project settings
    goto(`http://the-agent-company.com:8929/root/${project}/edit#js-advanced-settings`);
    noop(3000);

    // Expand Advanced settings
    click('button:has-text("Expand Advanced")');
    noop(2000);

    // Initiate deletion
    click('button:has-text("Delete project")');
    noop(2000);

    // Confirm deletion
    fill('#confirm_name_input', `root/${project}`);
    click('button:has-text("Yes, delete project")');
    noop(5000);  // Wait for deletion

    // Verify removal
    goto('http://the-agent-company.com:8929/dashboard/projects');
    noop(3000);
    scroll(0, 5000);  // Load all projects
    noop(2000);
}

// Final verification for sotopia
goto('http://the-agent-company.com:8929/root/sotopia');
noop(3000);
```

